import './scrollFeed.css'; 

function ScrollFeed() {
  return (
    <div className="scroll-feed">
      <div className="feed-item">Feed Item 1</div>
      <div className="feed-item">Feed Item 2</div>
      {/* Add more scroll items as needed */}
    </div>
  );
}

export default ScrollFeed;
